DECLARE @TenantID int
SET @TenantID = 2

/********************WQMPs***************/
--make fields nullable (should still be enforced on the front end)

ALTER TABLE dbo.WaterQualityManagementPlan
	ALTER COLUMN WaterQualityManagementPlanLandUseID int null;
ALTER TABLE dbo.WaterQualityManagementPlan
	ALTER COLUMN WaterQualityManagementPlanPriorityID int null;
ALTER TABLE dbo.WaterQualityManagementPlan
	ALTER COLUMN WaterQualityManagementPlanStatusID int null;
ALTER TABLE dbo.WaterQualityManagementPlan
	ALTER COLUMN WaterQualityManagementPlanDevelopmentTypeID int null;

--SELECT * FROM dbo.WaterQualityManagementPlan

INSERT INTO dbo.WaterQualityManagementPlan (TenantID, StormwaterJurisdictionID, WaterQualityManagementPlanLandUseID, WaterQualityManagementPlanPriorityID, WaterQualityManagementPlanDevelopmentTypeID, WaterQualityManagementPlanName, ApprovalDate,
			MaintenanceContactName,MaintenanceContactOrganization, MaintenanceContactPhone, MaintenanceContactAddress1, MaintenanceContactAddress2,MaintenanceContactCity,MaintenanceContactState, MaintenanceContactZip, HydromodificationAppliesID,
			DateOfContruction, HydrologicSubareaID, RecordNumber, RecordedWQMPAreaInAcres) 
SELECT DISTINCT
@TenantID,
StormwaterJurisdictionID,
WaterQualityManagementPlanLandUseID,
WaterQualityManagementPlanPriorityID,
WaterQualityManagementPlanDevelopmentTypeID,
Name,
Approval_date,
Contact_Name,
Organization,
Phone,
Address_Line_1,
Address_Line_2,
City,
State,
Zip,
HydromodificationAppliesID,
Date_of_Construction,
HydrologicSubareaID,
Jurisdiction_Record_ID,
WQMP_Area__Acres_  
FROM #allwqmps a
JOIN dbo.Organization o 
on a.Jurisdiction = o.OrganizationName and o.TenantID = @TenantID
JOIN dbo.StormwaterJurisdiction sj
on o.OrganizationID = sj.OrganizationID
LEFT JOIN dbo.WaterQualityManagementPlanLandUse lu
on a.Land_Use = lu.WaterQualityManagementPlanLandUseDisplayName
LEFT JOIN dbo.WaterQualityManagementPlanPriority pr
on a.Priority = pr.WaterQualityManagementPlanPriorityDisplayName
LEFT JOIN WaterQualityManagementPlanDevelopmentType dt
on a.Development_Type = dt.WaterQualityManagementPlanDevelopmentTypeDisplayName
LEFT JOIN HydromodificationApplies ha
on a.Hydromodification_Criteria = ha.HydromodificationAppliesDisplayName
LEFT JOIN HydrologicSubarea hs
on a.Hydrologic_Subarea = hs.HydrologicSubareaName
WHERE a.Jurisdiction IS NOT NULL

