INSERT INTO dbo.SourceControlBMP (TenantID, WaterQualityManagementPlanID, SourceControlBMPAttributeID, IsPresent, SourceControlBMPNote)
select @TenantID, mp.WaterQualityManagementPlanID, s.SourceControlBMPAttributeID, 1,
	CASE WHEN b.Notes = 'X' THEN 'Imported from spreadsheet on '+cast(cast(getdate() as date) as nvarchar(max))
	ELSE 'Imported from spreadsheet on '+cast(cast(getdate() as date) as nvarchar(max))+'; '+Notes END as Note
FROM #bmps b
JOIN SourceControlBMPAttribute s
on replace(Treatment,'_',' ') = s.SourceControlBMPAttributeName
JOIN dbo.Organization o 
on Jurisdiction = o.OrganizationName and o.TenantID = @TenantID
JOIN dbo.StormwaterJurisdiction sj
on o.OrganizationID = sj.OrganizationID
JOIN dbo.WaterQualityManagementPlan mp
on Name = mp.WaterQualityManagementPlanName and sj.StormwaterJurisdictionID = mp.StormwaterJurisdictionID 



INSERT INTO dbo.QuickBMP (TenantID, WaterQualityManagementPlanID, TreatmentBMPTypeID, QuickBMPName, QuickBMPNote)
select @TenantID, mp.WaterQualityManagementPlanID, t.TreatmentBMPTypeID, TreatmentBMPTypeName,
	CASE WHEN b.Notes = 'X' THEN 'Imported from spreadsheet on '+cast(cast(getdate() as date) as nvarchar(max))
	ELSE 'Imported from spreadsheet on '+cast(cast(getdate() as date) as nvarchar(max))+'; '+Notes END as Note
FROM #bmps b
JOIN TreatmentBMPType t
on replace(Treatment,'_',' ') = t.TreatmentBMPTypeName
JOIN dbo.Organization o 
on Jurisdiction = o.OrganizationName and o.TenantID = @TenantID
JOIN dbo.StormwaterJurisdiction sj
on o.OrganizationID = sj.OrganizationID
JOIN dbo.WaterQualityManagementPlan mp
on Name = mp.WaterQualityManagementPlanName and sj.StormwaterJurisdictionID = mp.StormwaterJurisdictionID

