/***************WaterQualityManagementPlanParcel**********************/
--Join by parcel number
SELECT a.Name, a.Jurisdiction, WaterQualityManagementPlanID, ParcelID, p.ParcelNumber 
INTO #joinbyAPN
FROM 
#allwqmps a
JOIN dbo.Parcel p
on a.Parcel_Number = p.ParcelNumber
JOIN dbo.Organization o 
on a.Jurisdiction = o.OrganizationName and o.TenantID = @TenantID
JOIN dbo.StormwaterJurisdiction sj
on o.OrganizationID = sj.OrganizationID
JOIN dbo.WaterQualityManagementPlan mp
on a.Name = mp.WaterQualityManagementPlanName and sj.StormwaterJurisdictionID = mp.StormwaterJurisdictionID
--WHERE a.Parcel_Number IS NOT NULL and p.ParcelID IS NOT NULL

SELECT TempID, Name, Jurisdiction, Latitude, Longitude, geometry::Point(Longitude, Latitude, 4326) as geom
INTO #latlong
FROM 
#allwqmps
WHERE Latitude IS NOT NULL and Longitude IS NOT NULL

SELECT a.Name, a.Jurisdiction, mp.WaterQualityManagementPlanID, p.ParcelID, p.ParcelNumber
into #joinbylatlong
FROM #latlong a
JOIN dbo.Parcel p
on a.geom.STIntersects(p.ParcelGeometry) = 1
JOIN dbo.Organization o 
on a.Jurisdiction = o.OrganizationName and o.TenantID = @TenantID
JOIN dbo.StormwaterJurisdiction sj
on o.OrganizationID = sj.OrganizationID
JOIN dbo.WaterQualityManagementPlan mp
on a.Name = mp.WaterQualityManagementPlanName and sj.StormwaterJurisdictionID = mp.StormwaterJurisdictionID

